import { NavLink } from 'react-router-dom';
import classes from './Dialogs.module.css'

const DialogItem = () => {
    return <div className={classes.dialog}>
        <NavLink to="/dialogs/1" activeClassName={classes.active}>Паша</NavLink>
    </div>
}

const Dialogs = () => {
    return (
        <div className={classes['dialogs']}>
            <div className={classes['dialogs-items']}>
                <div className={classes.dialog}>
                    <NavLink to="/dialogs/1" activeClassName={classes.active}>Паша</NavLink>
                </div>
                <div className={classes['dialog']}>
                    <NavLink to="/dialogs/2" activeClassName={classes.active}>Катя</NavLink>
                </div>
                <div className={classes['dialog']}>
                    <NavLink to="/dialogs/3" activeClassName={classes.active}>Эльдор</NavLink>
                </div>
            </div>
            <div className={classes['dialogs-messages']}>
                <div className={classes['message']}>Привет!</div>
                <div className={classes['message']}>Как дела?</div>
                <div className={classes['message']}>Что делаешь?</div>
            </div>
        </div>
    )
};

export default Dialogs;
